import React,{ Component,Fragment } from 'react'

import classes from './Button.css'

const button = ( props ) => {
    const style = (props.value==='=') ? 'background:#0CB999':null;
    return (<input type="button"
                   value={props.value}
                   onClick={props.clicked} style={style}/>);
};
export default button;
